import React from 'react';
import './components/About.css'

const About =() => {
  return (
    <>
  <div className="row">
  <div className="col-md-7">
  <p><span style={{fontWeight: "400"}}>Nimbus Logistics is a Heavy and ODC Transport Company formed in the year 1989 by an industry veteran, Mr. Naresh Agarwal, having experience in the field since 1978. Our company is majorly focused on the transportation of Break Bulk and Heavy Cargo, all across India. Nimbus Logistics houses trained and knowledgeable workforce well trained and experienced to take care of your consignments. Working alongside a large fleet of vehicles and state of the art equipment and machinery including Hydraulic Axles, Low Bed Trailers, Semi Bed Trailers, to the get your job done safely and flawlessly each and every time.</span></p>
  <p><span style={{fontWeight: "400"}}>Experience is a very valuable asset to hold in the field of Transport and logistics as it gives a foresight and vastly helps calibrate the exact need and expenses of any assignment in hand, making for a smooth and forecastable procedure. This experience is what is the pride and jewel here at Nimbus Logistics, housing staff with more than 30 years of experience in the field.</span></p>
  <p><span style={{fontWeight: "400"}}>Extremely rough and hostile environment is where the capabilities of our company truly shine. Our expertise and capability of handling cargo having massive weights and huge dimensions and transportation projects in extremely tough and remote areas is what Nimbus Logistics in known for. This fact is duly acknowledged in local newspapers along with photos of ODC cargo being transported through narrow, remote village roads on our vehicles.</span></p>
  <p><span style={{fontWeight: "400"}}>Our main priority while serving our customers is given to the aspect of safety. Our customer centric behaviour, Professional approach and Ethical practices are part of our Code of Conduct.</span></p>
  </div>
  <div className="col-md-5">
  <img src="truck.jpg" width="600" height="500" alt="truck" />
  </div>
  </div>

</>
);
}; 
export default About;
